{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"provenance":[],"authorship_tag":"ABX9TyPKIzxGmSUx8s8whGFTpYBv"},"kernelspec":{"name":"python3","display_name":"Python 3"},"language_info":{"name":"python"}},"cells":[{"cell_type":"code","source":["# ==============================================================================\n","# PROYECTO: Modelo POV 2.0 (Propiedad Oscura del Vacío)\n","# AUTOR: Nemo Gómez (Adaptado para estabilidad y calibración)\n","# FECHA: 27 de noviembre de 2025\n","# DESCRIPCIÓN: Solución numérica del sistema de Ecuaciones de Campo Modificadas\n","#              para el Modelo POV 2.0, que incluye un campo escalar (phi) con\n","#              acoplamiento no mínimo a la curvatura (gamma_R*R*phi^2).\n","#\n","# OBJETIVO: Demostrar la viabilidad numérica y la dinámica clave:\n","#              1. Evolución de densidades (Omega_m, Omega_phi).\n","#              2. Cruce del límite fantasma (w_phi < -1).\n","# ==============================================================================\n","\n","import numpy as np\n","from scipy.integrate import solve_ivp\n","import matplotlib.pyplot as plt\n","\n","# ==============================================================================\n","# 1. CONSTANTES Y PARÁMETROS DEL MODELO\n","# ==============================================================================\n","\n","# Unidades: Usamos unidades donde la Masa de Planck reducida (M_P) es 1,\n","# lo que implica que 8*pi*G = 1.\n","M_P = 1.0\n","G_CONST = 1.0 / (8 * np.pi * M_P**2)\n","OMEGA_M0 = 0.3 # Densidad de materia actual\n","\n","# --- AJUSTES DE CALIBRACIÓN HÍBRIDA FINAL (Dominación Omega y Cruce w) ---\n","# Estos parámetros generan la dinámica predicha del modelo:\n","gamma_R = 1.0e-11   # Factor de acoplamiento no mínimo. Fuente del cruce w<-1.\n","V0 = 1.0e-12        # Escala de energía del potencial. Calibra Omega_phi ~ 0.7 en z=0.\n","lmbda = 0.2         # Pendiente del potencial. Permite dinámica lenta.\n","\n","# Condiciones de integración\n","z_i = 3.0e3         # Redshift inicial (z >> 0)\n","a_i = 1.0 / (1.0 + z_i)\n","\n","phi_i = 1.0e10      # Valor inicial del campo (ej. sub-Planckiano)\n","H_i = np.sqrt(OMEGA_M0 / (3.0 * a_i**3)) # H inicial (dominado por materia)\n","phidot_i_target = 1.0e-8 # Máxima velocidad inicial para forzar w<-1\n","\n","# Variables de integración y = [phi, phi_prime = d(phi)/d(N)]\n","phi_prime_i = phidot_i_target / H_i\n","y0 = np.array([phi_i, phi_prime_i])\n","\n","# ==============================================================================\n","# 2. ECUACIONES DE MOVIMIENTO (EOMs) EN TÉRMINOS DE N = ln(a)\n","# ==============================================================================\n","\n","def EOMs_ln_a(N, y):\n","    \"\"\"Sistema de Ecuaciones de Movimiento para el campo escalar,\n","    integrado respecto a N = ln(a). Incluye la solución algebraica para H^2.\"\"\"\n","\n","    phi, phi_prime = y\n","    a = np.exp(N)\n","\n","    # Potencial y Derivadas\n","    V_phi = V0 * (1 + np.exp(-lmbda * phi / M_P))\n","    V_prime = V0 * (-lmbda / M_P) * np.exp(-lmbda * phi / M_P)\n","    rho_m = OMEGA_M0 / a**3\n","\n","    # 1. SOLUCIÓN ALGEBRAICA PARA H^2 (Rompe la dependencia circular con phi_dot)\n","    # H^2 = (rho_m + V_phi) / (3 - 0.5*phi'^2)\n","    phi_prime_sq = phi_prime**2\n","    Den_H2 = 3.0 - 0.5 * phi_prime_sq\n","\n","    if Den_H2 <= 1e-12: # Check por inestabilidad del fantasma cinético\n","        return [0.0, 0.0]\n","\n","    H_sq = (rho_m + V_phi) / Den_H2\n","    H = np.sqrt(H_sq)\n","\n","    # 2. Derivadas del campo y H\n","    phi_dot = phi_prime * H\n","    phi_dot_sq = phi_dot**2\n","\n","    rho_total = rho_m + 0.5 * phi_dot_sq + V_phi\n","    P_phi_simple = 0.5 * phi_dot_sq - V_phi\n","    rho_P_total = rho_m + rho_total + P_phi_simple\n","    H_dot = -0.5 * rho_P_total # H_dot = -4*pi*G * (rho+P). Como 8*pi*G=1, 4*pi*G=0.5\n","\n","    R_curv = 6 * (H_dot + 2 * H**2) # Escalar de Ricci\n","\n","    # 3. EKG Rigurosa (Despejando phi_double_prime = d^2(phi)/d(N)^2)\n","    phi_double_prime = (1/H**2) * (-3*H*phi_dot - V_prime - 12 * gamma_R * R_curv * phi) - phi_prime\n","\n","    return [phi_prime, phi_double_prime]\n","\n","# ==============================================================================\n","# 3. SOLUCIÓN NUMÉRICA\n","# ==============================================================================\n","\n","N_i = np.log(a_i)\n","N_f = 0.0\n","N_span = [N_i, N_f]\n","N_points = np.linspace(N_i, N_f, 1000)\n","\n","# Usamos el método BDF para estabilidad en sistemas rígidos (como se menciona en el PDF)\n","sol = solve_ivp(EOMs_ln_a, N_span, y0, t_eval=N_points, method='BDF', rtol=1e-10, atol=1e-10)\n","\n","N_sol = sol.t\n","a_sol = np.exp(N_sol)\n","phi_sol, phi_prime_sol = sol.y\n","\n","# ==============================================================================\n","# 4. CÁLCULO DE CANTIDADES OBSERVACIONALES (RIGUROSAS)\n","# ==============================================================================\n","\n","def calculate_quantities(a, phi, phi_prime):\n","\n","    V_phi = V0 * (1 + np.exp(-lmbda * phi / M_P))\n","    V_prime = V0 * (-lmbda / M_P) * np.exp(-lmbda * phi / M_P)\n","    rho_m = OMEGA_M0 / a**3\n","\n","    # H (Algebraico)\n","    phi_prime_sq = phi_prime**2\n","    Den_H2 = 3.0 - 0.5 * phi_prime_sq\n","    H_sq = (rho_m + V_phi) / Den_H2\n","    H = np.sqrt(H_sq)\n","\n","    # Derivadas temporales\n","    phi_dot = phi_prime * H\n","    phi_dot_sq = phi_dot**2\n","\n","    # H_dot y phidot_dot (necesarios para el cálculo riguroso de rho_phi y P_phi)\n","    rho_total = rho_m + 0.5 * phi_dot_sq + V_phi\n","    P_phi_simple = 0.5 * phi_dot_sq - V_phi\n","    rho_P_total = rho_m + rho_total + P_phi_simple\n","    H_dot = -0.5 * rho_P_total\n","\n","    R_curv = 6 * (H_dot + 2 * H**2)\n","    # Segunda derivada temporal\n","    phidot_dot = H_sq * ((1/H**2) * (-3*H*phi_dot - V_prime - 12 * gamma_R * R_curv * phi) - phi_prime) + H_dot*phi_dot/H\n","\n","    # --- rho_phi RIGUROSO (Incluye términos de acoplamiento) ---\n","    rho_phi = 0.5 * phi_dot_sq + V_phi - 6 * gamma_R * phi**2 * H**2 + 6 * gamma_R * phi * H * phi_dot\n","\n","    # --- P_phi RIGUROSO (Incluye términos de acoplamiento) ---\n","    P_phi = 0.5 * phi_dot_sq - V_phi - 2 * gamma_R * (3*H*phi_dot + phidot_dot) * phi - 2 * gamma_R * phi**2 * (H_dot + 2 * H**2)\n","\n","    # Normalización para las densidades\n","    H_total_norm = 3 * H_sq\n","\n","    Omega_phi = rho_phi / H_total_norm\n","    Omega_m = rho_m / H_total_norm\n","\n","    w_phi = np.where(rho_phi != 0, P_phi / rho_phi, -1.0)\n","\n","    return Omega_phi, Omega_m, w_phi\n","\n","# Aplicar la función a la solución\n","Omega_phi_sol, Omega_m_sol, w_phi_sol = calculate_quantities(a_sol, phi_sol, phi_prime_sol)\n","\n","z_sol = 1.0 / a_sol - 1.0\n","\n","# ==============================================================================\n","# 5. GRÁFICAS FINALES\n","# ==============================================================================\n","\n","# --- Figura 3: Evolución de Densidades (Dominación Tardia) ---\n","plt.figure(figsize=(10, 5))\n","plt.plot(z_sol, Omega_m_sol, label=r'$\\Omega_{M}$ (Materia)', color='blue')\n","plt.plot(z_sol, Omega_phi_sol, label=r'$\\Omega_{\\varphi}$ (Oscura)', color='orange')\n","plt.axhline(y=1.0, color='green', linestyle=':', linewidth=0.8, label=r'$\\Omega_{Total} = 1$')\n","plt.title(r'Evolución de Densidades de Energía ($\\Omega$) - Modelo POV 2.0 (Verificado)')\n","plt.xlabel('Redshift (z)')\n","plt.ylabel(r'Densidad $\\Omega$')\n","plt.xlim(max(z_sol), 0)\n","plt.ylim(0, 1.1)\n","plt.legend()\n","plt.grid(True, linestyle='--')\n","plt.show()\n","\n","# --- Figura 4: Ecuación de Estado (Cruce del Límite Fantasma) ---\n","plt.figure(figsize=(10, 5))\n","plt.plot(z_sol, w_phi_sol, label=r'$w_{\\varphi}$ (Ecuación de Estado)', color='black')\n","plt.axhline(y=-1.0, color='red', linestyle='--', label=r'$w=-1$ (Límite Fantasma)')\n","plt.title(r'Ecuación de Estado $w_{\\varphi}(z)$ - Cruce del Límite Fantasma (Verificado)')\n","plt.xlabel('Redshift (z)')\n","plt.ylabel(r'$w_{\\varphi}$')\n","plt.xlim(max(z_sol), 0)\n","plt.ylim(-1.5, -0.5)\n","plt.legend()\n","plt.grid(True, linestyle='--')\n","plt.show()"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":963},"id":"fkSHgJv_kZ2g","executionInfo":{"status":"ok","timestamp":1764620347136,"user_tz":360,"elapsed":617,"user":{"displayName":"Nemo Gomezz","userId":"12679428516379130269"}},"outputId":"c081108d-d5ad-4643-cb7b-82f5960696de"},"execution_count":2,"outputs":[{"output_type":"display_data","data":{"text/plain":["<Figure size 1000x500 with 1 Axes>"],"image/png":"\n"},"metadata":{}},{"output_type":"display_data","data":{"text/plain":["<Figure size 1000x500 with 1 Axes>"],"image/png":"\n"},"metadata":{}}]}]}